BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "mqttTopics" (
	"ID"	INTEGER NOT NULL UNIQUE,
	"topic"	Text,
	"descr"	Text,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "mqttPayloads" (
	"ID"	INTEGER NOT NULL UNIQUE,
	"ID_Topic"	INTEGER,
	"payload"	TEXT,
	"sync"	INTEGER,
	"DT"	Real,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "devices" (
	"ID"	INTEGER NOT NULL UNIQUE,
	"BEZEICHNUNG"	Text,
	"TYP"	Text,
	"AnlagenSchluessel"	Text,
	"SERIENNUMMER"	Text,
	"MAC"	Text,
	"IP"	Text,
	"STANDORT"	Text,
	"PLZ"	Text,
	"Ort"	Text,
	"Strasse"	Text,
	"HNr"	Text,
	"BEMERKUNGEN"	Text,
	"Pix1"	Text,
	"Pix2"	Text,
	"Pix3"	Text,
	"EMF"	Text,
	"GPS"	Text,
	"TOPIC"	Text,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "chanels" (
	"ID"	INTEGER NOT NULL UNIQUE,
	"ID_Device"	INTEGER,
	"ID_TOPIC"	Text,
	"NAME"	Text,
	"TYP"	Text,
	"UNIT"	Text,
	"BESCHREIBUNG"	Text,
	"InfoPktName"	Text,
	"Betriebsmittel"	Text,
	"lfdNr_BM"	Text,
	"SIGNALART"	Text,
	"payloadField_val"	Text,
	"payloadField_dt"	Text,
	"DESC"	Text,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Measurements" (
	"ID"	INTEGER NOT NULL UNIQUE,
	"ID_Chanel"	INTEGER,
	"DT"	REAL,
	"Wert"	REAL,
	"sync"	INTEGER,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "hourly_Measurements" (
	"ID"	INTEGER NOT NULL UNIQUE,
	"ID_Chanel"	INTEGER,
	"DT"	REAL,
	"Wert"	REAL,
	"cnt"	INTEGER,
	"sync"	INTEGER,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "daily_Measurements" (
	"ID"	INTEGER NOT NULL UNIQUE,
	"ID_Chanel"	INTEGER,
	"DT"	REAL,
	"Wert"	REAL,
	"cnt"	INTEGER,
	"sync"	INTEGER,
	PRIMARY KEY("ID" AUTOINCREMENT)
);
COMMIT;
